import '../styles/styles.css';
import Header from '../components/Header';



const App = ({Component, pageProps}) => {
  return (
      <div>
        <Header />
          <div className='min-h-screen container'>
            <Component {...pageProps} />
          </div>
          <div>
          footer
          </div>
      </div>
    );
}

export default App;
